import React from 'react';
import logo from './logo.svg';
import './App.css';

import Home from './pages/Home';
import { BrowserRouter, Routes, Route } from "react-router-dom";


function App() {
  return (
    <div className="App">
          <BrowserRouter>
      <Routes>
        <Route path= "/" element={<Home />}> </Route>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
